import React from "react";
import s from './Profile.module.css';
import My_posts from "./my_posts/My_posts";
function Profile() {
    return(
    <div className={s.content}>
        <img className={s.scenery}
             src="https://skyticket.com/guide/wp-content/uploads/2017/09/iStock-98731979-e1516765990706.jpg" alt=""/>
        <img className={s.Kaneki2}
             src="data:image/jpeg;base64,"
             alt=""/>
        <div className={s.About}>
            <p>Feral'</p>
            <p>Education: sharaga</p>
            <p>birth date: 8.12</p>

        </div>
        <My_posts/>
    </div>)
}
export default Profile;
